INSERT INTO `board` (`id`, `content`, `count`, `createDate`, `title`, `userId`) VALUES
	(1, '<p><span style="font-size: 18px; font-family: 굴림;"><b>1. ppt_hand_motion 프로젝트 선정 이유</b></span></p><ul><li><span style="font-family: 나눔스퀘어; font-size: 1rem;">국비 지원 교육을 통해 배운 python과 AI를 활용할 수 있는 방향으로 프로젝트 선정.</span></li><li><span style="font-family: 나눔스퀘어; font-size: 1rem;">플라스크를 사용하여 직접 작성한 코드로 ppt를 조작할 수 있는 페이지 개설 경험.</span></li><li><span style="font-family: 나눔스퀘어;">플러터를 이용할 경우, 스마트폰 카메라에 적용할 수 있을 가능성 기대.</span></li></ul><p><br></p><p><span style="font-family: 굴림; font-size: 18px; font-weight: bolder;">2.&nbsp;</span><span style="font-weight: 700; font-size: 18px; font-family: 굴림;">프로젝트 구상</span></p><p><span style="font-family: 나눔스퀘어;"><b><span style="font-family: " 맑은="" 고딕";"="">&nbsp;</span><span style="font-family: " 맑은="" 고딕";"="">2-1. 프로젝트 진행에 앞서, ppt 조작에 필요한 명령 탐색.</span></b></span></p><p><span style="font-family: 나눔스퀘어;">&nbsp; &nbsp; : 슬라이드쇼 시작, 슬라이드쇼 종료, 다음 페이지, 이전 페이지 등의 ppt에만 활용 가능한 내용 이외에도 화면 캡쳐, 마우스 조작 등의 동작을 구현할 수 있도록 계획을 세워 진행.</span></p><p><br></p><p><b><span style="font-family: 나눔스퀘어;" 맑은="" 고딕";"="">&nbsp;2-2.&nbsp;</span><span style="font-size: 1rem; font-family: 나눔스퀘어;" 맑은="" 고딕";"="">손 모양을 인식할 수 있는 3가지 모델 중, 하나를 선정.</span></b></p><p><span style="font-family: 나눔스퀘어;">&nbsp; &nbsp; 후보 1. Faster R-CNN</span></p><p style="text-align: center; "><span style="font-family: 나눔스퀘어;">&nbsp; &nbsp;&nbsp;</span><img src="data:image/png;base64," style="width: 50%;" data-filename="1.png"></p><p style="text-align: center; "><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-1. Faster R-CNN&gt;</span></p><p style="text-align: left;"><span style="color: rgb(0, 0, 0); font-family: 나눔스퀘어; font-size: 16px;">후보 영역 추출을 위해 사용</span><span style="color: rgb(0, 0, 0); font-family: 나눔스퀘어; font-size: 16px;">되는 Selective search 알고리즘은 CPU 상에서 동작하고 이로 인해 네트워크에서 병목현상이 발생하게다.&nbsp;</span><span style="font-family: 나눔스퀘어; text-align: center; font-size: 16px;">Faster R-CNN은&nbsp;</span><span style="color: rgb(0, 0, 0); font-family: 나눔스퀘어; font-size: 16px;">이러한 문제를 해결하고자&nbsp;</span><span style="color: rgb(0, 0, 0); font-family: 나눔스퀘어; font-size: 16px;">후보 영역 추출 작업을 수행하는 네트워크인 Region Proposal Network</span><span style="color: rgb(0, 0, 0); font-family: 나눔스퀘어; font-size: 16px;">(RPN)를 도입한 것이다.</span></p><p style="text-align: left;"><span style="color: rgb(0, 0, 0); font-family: 나눔스퀘어; font-size: 16px;">RPN에서 region proposals를 추출하고 이를 Fast R-CNN 네트워크에 전달하여 객체의 class와 위치를 예측하는 것으로 간단하게 설명하자면 RPN에서 bounding box를 생성하고, 이 bounding box를 한 픽셀씩 움직여 포착한 객체를 학습하는 것이다.</span></p><p style="text-align: left;"><span style="color: rgb(0, 0, 0); font-family: " spoqa="" han="" sans",="" sans-serif;="" font-size:="" 15px;"=""><br></span></p><p style="text-align: left;"><span style="color: rgb(0, 0, 0); font-family: " spoqa="" han="" sans",="" sans-serif;="" font-size:="" 15px;"="">&nbsp; &nbsp; 후보 2. YOLOv5</span></p><p style="text-align: left;"></p><div style="text-align: center;"><img src="data:image/png;base64," data-filename="2.png" style="font-size: 1rem; width: 564px;"></div><div style="text-align: center;"><p><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-2. YOLOv5&gt;</span></p><p style="text-align: left;"><span style="font-family: 나눔스퀘어;">CNN은 이미지를 여러 장으로 분할하여 분석하는 것이기 때문에 한 장의 이미지를 보더라도 여러 장의 이미지를 분석하는 것과 같은 효율을 가지게 된다. 하지만 YOLO(You Only Look Once)는 이러한 과정없이 이미지를 한 번만 보는 특징을 가지고 있다. </span></p><p style="text-align: left;"><span style="font-family: 나눔스퀘어;">또한, 다양한 전처리 모델과 인공 신경망을 결합하여 사용하던 기존의 Object Detection 모델과 달리 통합된 모델을 사용하여 실시간으로 객체를 탐지 할 수 있다.</span></p><p style="text-align: left;"><span style="font-family: 나눔스퀘어;"><br></span></p></div><div style="text-align: left;"><font color="#555555" face="나눔스퀘어">&nbsp; &nbsp; 후보 3. Media Pipe의&nbsp; Hands</font></div><div style="text-align: center;"><img src="data:image/png;base64," style="width: 248.984px;" data-filename="3.png"><font color="#555555" face="나눔스퀘어"><br></font></div><div style="text-align: center;"><p><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-3. Media Pipe Hands&gt;</span></p><p style="text-align: left;"><font face="나눔스퀘어">Media Pipe는 구글에서 제공하는 AI 프레임워크로서, 비디오 형식 데이터를 이용한 다양한 비전 AI 기능을 파이프라인 형태로 손쉽게 사용할 수 있도록 제공된 프레임워크이다. 이미 수많은 데이터셋을 가지고 학습을 마친 상태로 라이브러리와 같이 간편하게 호출이 가능하다.</font></p><p style="text-align: left;"><font face="나눔스퀘어">Media Pipe에서 제공하는 솔루션 중, Hands는 손 경계 박스를 반환하는 손바닥 감지 모델인 ML 파이프라인을 활용한다. 이는 손바닥 검출기로 추출하여 3D 핸드 키포인트를 반환하는 핸드 랜드마크 모델이다.</font></p><div style="text-align: left;"><br></div><div style="text-align: left;"><br></div></div><div style=""><b><font face="나눔스퀘어"><span style="font-family: " 맑은="" 고딕";"="">&nbsp;<span style="font-family: 나눔스퀘어;">2-3.&nbsp;</span></span></font><span style="font-family: 나눔스퀘어;" 맑은="" 고딕";="" font-size:="" 1rem;"="">Faster R-CNN 혹은</span><span style="font-family: 나눔스퀘어;" 맑은="" 고딕";="" font-size:="" 1rem;"="">&nbsp;</span><span style="font-family: 나눔스퀘어;" 맑은="" 고딕";="" font-size:="" 1rem;"="">YOLOv5</span></b></div><div style=""><font face="나눔스퀘어"><br></font></div><div style=""><font face="나눔스퀘어">우선은&nbsp;</font><span style="font-family: 나눔스퀘어; font-size: 1rem;">&nbsp;</span><span style="font-family: 나눔스퀘어; font-size: 1rem;">Faster R-CNN과 YOLOv5 두 가지 모델을 비교하기로 했다.&nbsp;</span><span style="font-family: 나눔스퀘어; font-size: 1rem;">두 모델의 가장 큰 차이점은 속도와 정확성에 있었다.</span></div><div style=""><font face="나눔스퀘어"><br></font></div><div style=""><font face="나눔스퀘어">Faster R-CNN의 경우는 YOLOv5보다 높은 정확성을 보이지만, 속도가 느리고,</font></div><div style=""><font face="나눔스퀘어"><br></font></div><div style=""><font face="나눔스퀘어">YOLOv5의 경우는 Faster R-CNN보다 속도가 빠른 대신에 불안한 정확성을 보이는 것이다.</font></div><div style=""><font face="나눔스퀘어"><br></font></div><div style=""><font face="나눔스퀘어">ppt_hand_motion 프로젝트는 얼마나 빠르게 손을 인식하는가 보다는 얼마나 정확하게 인식하여 그에 맞는 동작을 수행하는가 에 초점을 맞춰야 한다고 생각하여 Faster R-CNN을 선정하게 되었다.</font></div><div style=""><font face="나눔스퀘어">(Media Pipe를 배제한 이유는&nbsp;</font><span style="font-size: 1rem; font-family: 나눔스퀘어;">손 동작을 보였을 때, 내가 원하는 동작을 수행할 수 있게 만들기 위해서는 이미지 자체로 훈련을 시켜야만 한다는 편협한 생각 때문이었다.</span><span style="font-size: 1rem; font-family: 나눔스퀘어;">)</span><font face="나눔스퀘어"><br></font></div><div style=""><font face="나눔스퀘어"><br></font></div><div style=""><b style="font-family: 나눔스퀘어; font-size: 1rem;"><br></b></div><div style=""><span style="font-weight: 700; font-family: 굴림; font-size: 18px;">3</span><span style="font-weight: 700; font-size: 18px; font-family: 굴림;">. 프로젝트 진행</span></div><div style=""><span style="font-weight: 700; font-size: 1rem; font-family: 굴림;"><br></span></div><div style=""><div style=""><font face="나눔스퀘어">총 5명으로 진행된 프로젝트는 크게 프론트엔드, 백엔드, 플라스크를 이용한 서버 구축 3 가지로 나뉘고 시간이 남게 될 경우, 플러터를 이용한 앱 개발을 진행하기로 했다.</font></div><div style=""><font face="나눔스퀘어"><br></font></div><div style=""><font face="나눔스퀘어"><b>&nbsp;3-1. 데이터 수집</b></font></div><div style=""><font face="나눔스퀘어"><br></font></div><div style="text-align: center; font-family: 나눔스퀘어;"><img src="data:image/png;base64," style="width: 25%;" data-filename="4.png"><img src="data:image/png;base64," style="width: 25%;" data-filename="5.png"><img src="data:image/png;base64," style="width: 25%;" data-filename="6.png"></div><div style="text-align: center;"><p style="font-family: -apple-system, BlinkMacSystemFont, " segoe="" ui",="" roboto,="" "helvetica="" neue",="" arial,="" "noto="" sans",="" "liberation="" sans-serif,="" "apple="" color="" emoji",="" "segoe="" ui="" symbol",="" emoji";"=""><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-4. hand bounding box&gt;</span></p><p style="text-align: left;"><font face="나눔스퀘어">그 중에서 백엔드 부분을 맞게 되어 제일 처음으로 진행한 것이 필요한 사진을 수집(직접 촬영)하여 Faster R-CNN으로 훈련할 수 있도록 bounding box를 그린 것이다.</font></p><p style="text-align: left;">처음에는 사진 하나하나 직접 box를 그리고 있었지만, Media Pipe를 사용하여 bounding box를 그려주는 코드를 작성할 수 있을 것이라는 생각에 직접 코드를 구현해봤다.</p><p style="text-align: left;"><br></p><p style="text-align: center;"><img src="data:image/png;base64," style="width: 638.984px;" data-filename="7.png"></p><p segoe="" ui",="" roboto,="" "helvetica="" neue",="" arial,="" "noto="" sans",="" "liberation="" sans-serif,="" "apple="" color="" emoji",="" "segoe="" ui="" symbol",="" emoji";"=""><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-5. bounding box 코딩&gt;</span></p><p style="text-align: left;"><font face="나눔스퀘어">코드에 대해 간단하게 설명하자면 손 이미지를 가지고 Media Pipe Hands로 랜드마크를 받아 제일 큰 x좌표와 제일 큰 y좌표를 이용하여 우하단의 좌표를 생성하고, 제일 작은 x좌표와 제일 작은 y좌표를 이용하여 좌상단의 좌표를 만들어 사각형을 그린 후, 저장하는 것이다.</font></p><p style="text-align: left;"><span style="font-family: 나눔스퀘어;">이런 식으로 사진 별 300개, 총 1200장의 사진에 bounding box를 그려 사용했다.</span></p><p style="text-align: left;"><br></p><p style="text-align: left;"><b>&nbsp;</b><span style="font-family: 나눔스퀘어; font-weight: bolder; font-size: 1rem;">3-2. 계획 변경</span></p><p style="text-align: left;"><br></p><p style="text-align: left;"><span style="font-family: 나눔스퀘어;">Faster R-CNN을 사용하기 위해 Media Pipe를 사용하면서 깨달은 점이 있었다.</span></p><p style="text-align: left;"><span style="font-family: 나눔스퀘어;">Media Pipe의 경우는 이미 엄청난 양의 데이터셋을 사용하여 훈련이 진행된 상태로 어두운 환경이나 흐릿한 이미지에서도 손을 인식할 수 있을 정도의 정확성을 가지고 있던 것이다.</span></p><p style="text-align: left;"><span style="font-family: 나눔스퀘어;">또한, 랜드마크 정보만 존재한다면 각 손가락 좌표의 크기를 조절하여 원하는 동작을 했을 때, 명령을 수행할 수 있을 것이라 생각했다.</span></p><p style="text-align: left;"><span style="font-family: 나눔스퀘어;">무엇보다 개발 시간의 단축과 함께 모바일에서도 돌릴 수 있을 정도로 가벼운 장점을 가지고 있는 Media Pipe를 굳이 사용하지 않을 이유가 없었다.</span></p><p style="text-align: left;"><br></p><p style="text-align: left;">&nbsp;<span style="font-family: 나눔스퀘어; font-weight: 700; font-size: 1rem;">3-3. 코드 작성</span></p><p style="text-align: center;"><img src="data:image/png;base64," style="width: 935px;" data-filename="17.png"><span style="font-family: 나눔스퀘어; font-weight: 700; font-size: 1rem;"><br></span></p><p style="text-align: center;"><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-6. 랜드마크를 이용한 손가락 각도 추출&gt;</span></p><p style="text-align: center;"></p><div style="text-align: left;"><p><font face="나눔스퀘어"><span style="font-family: 나눔스퀘어;">Media Pipe Hands로 받아올 수 있는 손가락 관절의 랜드마크(자세한 위치 번호는 사진 1-3번 참조)를 이용하여 손가락을 접거나 펼쳤을 때의 각도를 angle_list에 저장하는 코드를 작성.</span></font><br></p><p><span style="font-family: 나눔스퀘어;">hand_에 담겨있는 값은 [[x, y], [x, y], [x, y]]의 형태로 랜드마트 0번 위치의 x, y 좌표, 1번 위치의 x, y 좌표 순서로 존재하여&nbsp;</span><span style="font-family: 나눔스퀘어;">두 좌표의 차를 vector_2d_angle() 함수에 대입한다.</span></p><p><br></p><p style="text-align: center; "><img src="data:image/png;base64," style="width: 955px;" data-filename="18.png"></p><p style="text-align: center; "><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-7. vector_2d_angle&gt;</span></p><p style="text-align: center; "></p><div style="text-align: left;"><font face="나눔스퀘어"><span style="font-size: 16px; font-family: 나눔스퀘어;">vector_2d_angle() 함수는 대입한 v1, v2를 가지고 acos()을 이용하여 두 값 사이의 각도를 찾아낸다.(\'</span></font><span style="background-color: rgb(255, 255, 255);"><span style="font-family: 나눔스퀘어; font-size: 14px; white-space: pre;"><font color="#000000">(v1_x**2 + v1_y**2)**0.5</font></span><span style="font-family: 나눔스퀘어;">?\'와 \'</span></span><span style="color: rgb(0, 0, 0); font-family: 나눔스퀘어; font-size: 14px; white-space: pre;">(v2_x**2 + v2_y**2)**0.5\'</span><span style="font-size: 1rem;"><span style="font-family: 나눔스퀘어;">&nbsp;는 두 노드 간의 직선 차이</span></span><span style="font-size: 1rem; font-family: 나눔스퀘어;">)</span></div><p></p></div><span style="font-family: 나눔스퀘어; font-weight: 700; font-size: 1rem;"><br></span><p></p><p style="text-align: center;"><img src="data:image/png;base64," style="width: 100%;" data-filename="16.png"><br></p><p style="text-align: center;"><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-8. hand motion 코딩(손가락 하나)&gt;</span></p><p style="text-align: center;"><span style="font-family: 나눔스퀘어; font-size: 12px;"><br></span></p><p style="text-align: center;"><img src="data:image/png;base64," style="width: 25%;" data-filename="8.png"><img src="data:image/png;base64," style="width: 25%;" data-filename="9.png"><img src="data:image/png;base64," style="width: 25%;" data-filename="10.png"><img src="data:image/png;base64," style="width: 25%;" data-filename="11.png"><span style="font-family: 나눔스퀘어; font-size: 12px;"><br></span></p><p style="text-align: center;"><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-9. 손가락 인식&gt;</span></p><p style="text-align: center;"></p><div style="text-align: left;"><p><font face="나눔스퀘어">위에서 정의한 vectod_2d_angle()을 이용하여 각도가 90도를 넘기는 손가락은 접은 것으로 판단하며, 30~40도를 기준으로 손가락을 펼친 것으로 정의하여 각 손가락마다 index를 부여했다.</font><br></p><p><br></p><p><img src="data:image/png;base64," style="width: 1088px;" data-filename="19.png"><br></p></div><div style="text-align: left;"><p style="text-align: center; "><span style="font-size: 12px; font-family: 나눔스퀘어;">&lt;사진 1-10. hand motion 코딩(다중 손가락)&gt;</span><br></p></div><div style="text-align: left;"><p><span style="font-family: 나눔스퀘어;">또한, 다양한 기능을 추가하기 위해 손가락 하나만을 인식하는 것이 아닌 여러 손가락을 동시에 인식하여 다양한 제스처를 통해 명령을 전달할 수 있도록 작성했다.</span><br></p><p><br></p></div><div style="text-align: center;"><img src="data:image/png;base64," style="width: 25%;" data-filename="12.png"><img src="data:image/png;base64," style="width: 25%;" data-filename="13.png"><img src="data:image/png;base64," style="width: 25%;" data-filename="14.png"><img src="data:image/png;base64," style="width: 25%;" data-filename="15.png"></div><p></p><div style="text-align: left;"><p style="text-align: center; "><span style="font-size: 12px; font-family: 나눔스퀘어;">&lt;사진 1-11. 다중 손가락 인식&gt;</span></p><p><font face="나눔스퀘어">무엇보다 keypoint_pos를 이용하여 랜드마크 4번(엄지 손가락 끝)과 8번(검지 손가락 끝)의 x좌표의 값을 통해 왼손과 오른손을 분간하여 서로 다른 명령을 줄 수 있도록 만들었다.</font></p><p><span style="font-family: 나눔스퀘어;"><br></span></p><p style="text-align: center; "><img src="data:image/png;base64," style="width: 917px;" data-filename="20.png"><span style="font-family: 나눔스퀘어;"><br></span></p><p style="text-align: center; "><span style="font-size: 12px; font-family: 나눔스퀘어;">?&lt;사진&nbsp; 1-12. 키 이벤트 코딩&gt;</span><span style="font-family: 나눔스퀘어;"><br></span></p><p><span style="font-family: 나눔스퀘어;">마지막으로 사용하고 싶은 제스처의 이름을 변경하고(ex : 12_right -&gt; Next_page) pyautuogui 라이브러리를 사용하여 해당 제스처를 취할 때, 키보드 이벤트가 입력되도록 설정했다.</span></p><p><span style="font-family: 나눔스퀘어;">이제 ppt 파일을 펼친 후, 코드를 실행시키면 키보드 이벤트를 받아 슬라이드 쇼 시작, 종료, 다음 페이지, 이전 페이지, 스크린샷 등 동작을 이행할 수 있게 된다.</span></p><p><span style="font-family: 나눔스퀘어;"><br></span></p><p><span style="font-family: 나눔스퀘어;"><b>&nbsp;3-4. 플라스크(Flask) 적용</b></span></p><p><span style="font-family: 나눔스퀘어;"><br></span></p><p><span style="font-family: 나눔스퀘어;">플라스크(Flask) : 간단한 웹 사이트, 혹은 간단한 API 서버를 만드는 데에 특화 되어있는 Python Web Framework이다.</span></p><p><span style="font-family: 나눔스퀘어;">즉, 위에서 작성한 python 코드를 python 프로그램을 이용하여 돌리는 것이 아닌, 서버에서 실행시킬 수 있도록 만들기 위해 플라스크(Flask)를 적용시켜 ppt를 조작할 수 있는 카페를 만들어 보기로 결정했다.</span></p><p><br></p><p style="text-align: center; "><img src="data:image/png;base64," style="width: 884px;" data-filename="21.png"><span style="font-family: 나눔스퀘어;"><br></span></p><p style="text-align: center; "><span style="font-size: 12px; font-family: 나눔스퀘어;">&lt;사진 1-13. 기본 페이지 html&gt;</span></p><p><br></p><p style="text-align: center; "><img src="data:image/png;base64," style="width: 962px;" data-filename="23.png"><br></p><p></p><p style="text-align: center; "><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-14. 실제 UI&gt;</span></p><p><span style="font-family: 나눔스퀘어;">플라스크도 일반적인 라이브러리와 같이 import를 하여 작동할 수 있는데, 먼저 html 파일을 생성하여 기본적인 카페의 틀을 만들었다.</span><br></p><p><span style="font-family: 나눔스퀘어;">이렇게 만들어진 html 파일은 단순하게 화면만을 띄우고 다른 페이지로 넘길 수 있을 뿐, 위에서 만든 코드를 실행시킬 수 없다. 즉, html과 python을 연결시키기 위해서는 플라스크(Flask)로 연동을 해야한다.</span></p><p><span style="font-family: 나눔스퀘어;"><br></span></p><p style="text-align: center; "><img src="data:image/png;base64," style="width: 601px;" data-filename="22.png"><span style="font-family: 나눔스퀘어;"><br></span></p><p style="text-align: center; "><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-15. Flask 연동&gt;</span></p><p><font face="나눔스퀘어">html 파일과 플라스크를 연동하려면 @app.route("접속할 페이지 주소")로 연결시키고 render_template("html 파일")을 return하여 페이지를 띄울 수 있게 만든다.(위에서 작성한 코드가 동작하는 페이지는 index3.html)</font></p><p><font face="나눔스퀘어"><br></font></p><p style="text-align: center; "><img src="data:image/png;base64," style="width: 623px;" data-filename="26.png"><font face="나눔스퀘어"><br></font></p><p style="text-align: center; "><span style="font-size: 12px; font-family: 나눔스퀘어;">&lt;사진 1-16. index3.html에서 python 코드 호출&gt;</span></p><p><font face="나눔스퀘어">사진 1-14번의 UI에서 Hand detection을 클릭하면 index3.html로 넘어가게 되는데, 여기서 python 코드를 실행시키기 위해서는 사진 1-16번과 같이 {{ url_for }}을 사용하여&nbsp;</font><span style="font-family: 나눔스퀘어; font-size: 1rem;">@app.route()로 연결된 페이지를 호출할 수 있게 만들어야 한다.</span></p><p><span style="font-family: 나눔스퀘어; font-size: 1rem;">사진 1-15번에서&nbsp;</span><span style="font-family: 나눔스퀘어; font-size: 1rem;">@app.route("/video_feed3") 부분을 보면 Rsponse()를 사용하여 detect() 함수를 호출하는 것을 확인할 수 있다.</span></p><p><span style="font-family: 나눔스퀘어; font-size: 1rem;"><br></span></p><p style="text-align: center; "><img src="data:image/png;base64," style="width: 504px;" data-filename="25.png"><span style="font-family: 나눔스퀘어; font-size: 1rem;"><br></span></p><p style="text-align: center; "><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-17. detect() 함수&gt;</span></p><p><span style="font-family: 나눔스퀘어;">detect() 함수는 위에서 작성한 python 코드를 실행시키는 함수로 /video_feed3가 호출되는 순간 동작하게 된다.</span></p><p><span style="font-family: 나눔스퀘어;"><br></span></p><p style="text-align: center; "><img src="data:image/png;base64," style="width: 962px;" data-filename="24.png"><span style="font-family: 나눔스퀘어;"><br></span></p><p style="text-align: center;"><span style="font-family: 나눔스퀘어; font-size: 12px;">&lt;사진 1-18. 실제 동작&gt;</span></p><p><span style="font-family: 나눔스퀘어;"><br></span></p></div><div style="text-align: left;"><font face="나눔스퀘어"><span style="font-size: 18px; font-family: 굴림;"><b>4. 프로젝트를 마치며</b></span></font></div><div style="text-align: left;"><font face="나눔스퀘어"><br></font></div><div style="text-align: left;"><p><font face="나눔스퀘어"><b>&nbsp;4-1. 아쉬운 점</b></font></p><ul><li><font face="나눔스퀘어">프로젝트 진행 초반에 팀원들 간의 소통이 원활하지 못했다. Faster R-CNN 모델을 선택하고, 모델에 대한 이해가 필요하여 각자 공부하는 시간을 가졌는데, 각자가 공부하는 자료가 다른 상태로(Faster R-CNN이 bounding box를 사용하는 것과 Segmentation을 사용하는 두 가지로 나뉨.) 시간이 오래 흘렀고, 그러한 사실도 너무 늦게 깨달았었다.</font></li><li><font face="나눔스퀘어">뒤늦게 Media Pipe로 시선을 돌린 것도 아쉬움이 컸다. 조금만 더 일찍 계획을 수정했다면 시간에 쫓기는 일 없이 여유를 가지고 프로젝트를 진행하여 더 나은 퀄리티의 결과물을 이끌어 낼 수 있었을 것 같다는 아쉬움이 많이 남았다.</font></li><li><font face="나눔스퀘어">플러터(Flutter) 활용 실패. 사실 이 프로그램의 최종 목표는 스마트폰에서 실행할 수 있게 만드는 것이었다. 그러기 위해서 플러터를 활용하여 앱을 만들고, 만약, 앱에서도 제스처를 통해 여러 기능을 작동시킬 수 있다면 터치 없이 사진을 찍거나 동영상을 재생하는 등의 내용을 추가하려고 했다. 하지만 2주라는 짧은 시간 안에 플러터의 언어인 Dart와 Media Pipe를 사용하기 위해서는 Kotlin을 사용해야 하는 장벽이 있어서 카메라에 적용시킬 수 있는 앱을 제작하는데 어려움을 겪었다.</font></li></ul><p style="text-align: center; "><img src="data:image/png;base64," style="width: 1006px;" data-filename="27.png"><font face="나눔스퀘어"><br></font></p><p style="text-align: center;"><span style="font-size: 12px;">&lt;사진 1-19. Flutter 시도&gt;</span></p><p><br></p><p><b>&nbsp;4-2. 개선 사항</b></p><ul><li>위에서 말했듯이 플러터(Flutter)에 Media Pipe를 활용할 수 있다면 이보다 훨씬 많은 기능을 구현할 수 있을 것이라 판단된다.</li><li>ppt 조작 이외의 다른 기능. 현재 프로젝트에 사용된 기능은 키보드 이벤트에 국한된 것이다. 때문에 pyautuogui 라이브러리가 아닌 다른 라이브러리가 존재한다면 훨씬 더 나은 명령을 수행할 수 있을 것이라 판단된다.</li><li>마우스 조작. 현 프로젝트에서도 검지와 중지를 동시에 사용하면 마우스 조작이 될 수 있도록 코드를 만들었다.(pyautuogui 라이브러리) 하지만, 컴퓨터의 캠을 벗어나지 못하는 상태에서 마우스를 조작하게 된다면 사용자가 원하는 위치까지 마우스 이동이 쉽게 되지 않는다. 또한, 마우스가 움직이게 될 경우 심한 렉이 걸리게 되며, 주먹을 쥐는 것을 클릭으로 설정하자 필요하지 않은 상황에서도 작동하여 불편함을 동반하였다.</li></ul><p><br></p><p><br></p></div><p></p></div></div><p></p>', 0, '2022-09-28 01:06:39.858580', '1. (python) ppt_hand_motion', 1);
